import React from "react";
import './App.css';

//BOOTSTRAP
import "bootstrap/dist/css/bootstrap.min.css";
//ROTAS
import Rotas from "./rotas";
import { BrowserRouter as Router } from "react-router-dom";

const Context = React.createContext({
  "token": ""
});

function App() {
  return (
    <Context.Provider>
      <Router>
        <Rotas />
      </Router>
    </Context.Provider>
  );
}

export default App;
